import React from 'react';


const Navbar = () => {
  return (
    <div className='navbar'>
      <img src="/images/logowhite.png" alt="Logo" className="logo" />

        <p className='guides'>Guides</p>
        <p className='walkthrough'>Walkthrough</p>
        <p className='forum'>Forum</p>
        <p className='giftcodes'>Gift Codes</p>

      <div className="profile-section">
        <img src="/images/profilelogo.png" alt='profilelogo' className='profilelogo' />
        <p>Sign In</p>
      </div>
    </div>
  );
}


export default Navbar;
